import React from 'react';

import Facing from './Facing';
import Card from '../UI/Card';
import './Shelf.css';

const Shelf = (props) => {
  return (
    <Card className='shelf'>
      <Facing 
      upc={props.upc} 
      shelf={props.shelf} 
      gondula={props.gondula}/>

    </Card>
  );
}

export default Shelf;
